import React, { Component } from "react";
import "./Footer.css";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faFacebookMessenger,
  faFacebookF,
  faInstagram
} from "@fortawesome/free-brands-svg-icons";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { Link, IconButton } from "@material-ui/core";

class Footer extends Component {
  render() {
    return (
      <div className="footer-container">
        <div>
          <span
            style={{
              color: "black",
              fontSize: 17,
              fontWeight: "bold"
            }}
          >
            Find us on:
          </span>
          <br />
          <IconButton>
            <Link href="https://www.facebook.com/rogervnn/">
              <FontAwesomeIcon
                icon={faFacebookF}
                color={"blue"}
                style={{ width: 30, height: 30 }}
              />
            </Link>
          </IconButton>
          <IconButton>
            <Link href="https://m.me/rogervnn?fbclid=IwAR0Ozfd8hPuSbteKHsg-V31eD52mjeL9QdVn8QjQTUo_t1j-JB0Ij-JCyMw">
              <FontAwesomeIcon
                icon={faFacebookMessenger}
                style={{ width: 30, height: 30, color: "#4fc3f7" }}
              />
            </Link>
          </IconButton>
          <IconButton>
            <Link href="https://www.facebook.com/rogervnn/">
              <FontAwesomeIcon
                icon={faInstagram}
                style={{ width: 30, height: 30, color: "#7e57c2" }}
              />
            </Link>
          </IconButton>
          <IconButton>
            <Link href="mailto:rogershoesvn@gmail.com">
              <FontAwesomeIcon
                icon={faEnvelope}
                style={{ width: 30, height: 30, color: "#ef5350" }}
              />
            </Link>
          </IconButton>
        </div>
        <div>
          <span className="title-footer">
            © 2009–2019 Zappos LLC or its affiliates, 400 East Stewart Avenue.
            Las Vegas NV 89101
          </span>
          <br />
          <span className="title-footer">
            6pm.com is operated by Zappos IP LLC. Products on 6pm.com are sold
            by 6pm.com, LLC.
          </span>
          <br />
          <span className="title-footer">
            e-Gift Cards on 6pm.com are sold by ACI Gift Cards LLC.
          </span>
          <br />
          <span className="title-footer">
            © 2016 - Bản quyền của Công Ty Cổ Phần Ti Ki - Tiki.vn 
          </span>
          <br />
          <span className="title-footer">
            For luxury and designer styles, visit Zappos Luxury.
          </span>
          <br />
        </div>
      </div>
    );
  }
}

export default Footer;
